script: |
  super -f text -I q5532.spq | sort > q5532.out

inputs:
  - name: q5532.spq
    data: |
      SELECT - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE ( - col2 + - 92 + - col1 ) BETWEEN ( + - 19 ) * CAST ( NULL AS INTEGER ) * - col1 AND NULL;
  - name: tab0

outputs:
  - name: q5532.out
    data: |
